export default class Navigation extends React.Component {
    constructor() {
        super()
        this.state = {
            query: ' ',
        }
    }

    handleInputChange = () => {
        this.setState({
          query: this.search.value
        })
      }

    render() {
        return(
            <form>

                <input placeholder="Add Class..."
                       onChange={this.handleInputChange}
                       className="form-control"/>
                <button className="btn btn-primary">
                </button>
            </form>
        )


    }





}
